import classes from './InfoBox.module.css';

// Generic function component to display contents inside a box with title
export const InfoBox = (props: any) => (
    <div className={classes.InfoBox}>
        <div className={classes.InfoBoxHeader}>{props.title}</div>
        <div className={classes.InfoBoxContent}>{props.children}</div>
    </div>
);
